import HeaderStyles from './Header.module.css';

const Header = () => {

    const [dated, setDate] = useState({hh:'', mm:'', ss:'', meri:''});
    let date, hours, minutes, seconds, meri = "AM";
  setInterval(() => {
     date = new Date();
     hours = date.getHours();
     minutes = date.getMinutes();
     seconds = date.getSeconds();
     meri = "AM"

    if(hours >12) {
      hours = hours - 12;
      meri = "PM"
    }

    if(seconds < 10) {
      seconds = "0" + seconds;
    }

    console.log(`${hours}:${minutes}:${seconds} ${meri}` );
  }, 1000);

    return  <header className={HeaderStyles.header}>
                <h1>Todos App</h1>
                <small className={HeaderStyles.tagLine}>Centralized platform for managing your daily tasks and work items.</small>
                <small></small>
            </header>
};

export default Header;
